import Layout from '../components/layout';
import CartInstances from '../components/CartInstances';
import {
  useInstance,
  useInstancelength,
  useInstanceDispatch,
} from './contexts/CartContext';
import { useUser } from './contexts/userContext';
import { useEffect } from 'react';

export default function Cart() {
  const i = 1;
  var iteminstances = [];
  console.log('iteminstances: ', iteminstances);
  const { state } = useInstancelength();
  console.log('props: ', state);
  const { cartitems } = useInstance();
  console.log('props1: ', cartitems);
  const dispatch = useInstanceDispatch();
  const user = useUser();

  const getAllcarts = (event) =>
    dispatch({
      type: 'GETALL',
      user: sessionStorage.getItem('key'),
    });

  useEffect(() => {
    getAllcarts();
  }, ['1']);

  //useEffect();

  return (
    <Layout>
      {/* Create a card for each item */}
      <div className='card-columns'>
        {iteminstances &&
          iteminstances.map((iteminstance) => (
            <CartInstances iteminstance={iteminstance} key={iteminstance._id} />
          ))}{' '}
        {!iteminstances && <div>No items</div>}
      </div>
    </Layout>
  );
}
